import React from 'react'
import PaymentModel from '../../../Models/PaymentModel'
import { Link } from 'react-router-dom'

const PaymentListCard:React.FC<{payments:PaymentModel[] | undefined}> = (props) => {
  return (
    <>
    {props.payments?.map((payment: PaymentModel, index: number) => (
      <div key={index} className="inbox-item">
        <Link to={`/admin/payments:${payment.checkoutId}`}>
          {/* <div className="inbox-item-img">
          </div> */}
          <h5 className="inbox-item-author mt-0 mb-1">{payment.checkoutId}</h5>
          {/* <h6>{JSON.parse(payment.createdAt)}</h6> */}
          {/* <p className="inbox-item-text">{message.messageBody.length > 50 ? `${message.messageBody.slice(0,50)}...` : message.messageBody}</p>
          <p className="inbox-item-date">{message.createdAt.slice(0,16)}</p> */}
        </Link>
      </div>
    ))}
  </>
  )
}

export default PaymentListCard
